// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import LandingPage from './pages/LandingPage';
import Login from './pages/LoginPage';
import Register from './pages/RegisterPage';
import ResidentDashboard from '../dashboards/ResidentDashboard';
import SecretaryDashboard from './dashboards/SecretaryDashboard';
import TreasurerDashboard from './dashboards/TreasurerDashboard';
import MaintenanceDashboard from './dashboards/MaintenanceDashboard';
import SecurityDashboard from './dashboards/SecurityDashboard';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/resident/*" element={<ResidentDashboard />} />
          <Route path="/secretary/*" element={<SecretaryDashboard />} />
          <Route path="/treasurer/*" element={<TreasurerDashboard />} />
          <Route path="/maintenance/*" element={<MaintenanceDashboard />} />
          <Route path="/security/*" element={<SecurityDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
